import React from "react";
import { useState } from "react/cjs/react.development";
// Styling

const SearchBar = (props) => {
  return (
    <input
      className="searchBar"
      onChange={(event) => useState(event.target.value)}
      placeholder="Search for a cookie name"
    />
  );
};

export default SearchBar;
